export const ProviderIcon = ({ provider, size = 20 }: { provider: string, size?: number }) => {
  const isPatreon = provider.toLowerCase() === 'patreon';
  
  return (
    <svg 
      width={size} 
      height={size} 
      // Important: Use the specific viewBox for SubscribeStar, 
      // Patreon usually fits in 24x24 but we can scale it here
      viewBox={isPatreon ? "0 0 24 24" : "0 0 1584 1584"} 
      xmlns="http://www.w3.org/2000/svg"
      style={{ marginRight: '12px', flexShrink: 0 }}
    >
      {isPatreon ? <PatreonSVG /> : <SubscribeStarSVG />}
    </svg>
  );
};